import '../css/style-button.css'
import React from 'react';


const Button = (props) => {
    return(
        <button className = "button-layout" onClick = {props.onButtonClick} style={{ background: `${props.primaryColor}` }}>
            <i className = {`fa ${props.iconName}`}/>
            <span style ={{marginLeft: "20px"}}>{props.children}</span>
        </button>
    );
}



export default Button;
